import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Board from "./components/Board";

function App() {
  return (
    <Note>
    <Router>
      <Routes>
        <Route path="/" exact element={<Board />} />
      </Routes>
    </Router>
    </Note>
  );
}

export default App;
